<p data-start="6940" data-end="7179">If after this you see only the blue debug sphere and no Moon, then the GLB itself may have issues (we can poke at that next, but at least this setup isolates viewer vs asset instead of fighting Wix hosting + CORS + three.js all at once).</p>
